class Solution {
    public int minSubarray(int[] nums, int p) {
        int n = nums.length;
        long arraySum = Arrays.stream(nums).asLongStream().sum(); 
        int targetRemainder = (int) (arraySum % p);
        if (targetRemainder == 0) {
            return 0;
        } else if (arraySum < p) {
            return -1;
        }

        Map<Integer, Integer> remainderToIndex = new HashMap<>();
        remainderToIndex.put(0, -1);

        long preSum = 0;
        int minLen = Integer.MAX_VALUE;
        for (int i = 0; i < n; ++i) {
            preSum += nums[i];
            int remainder = (int) (preSum % p);
            int remainderToCheck = (int) (remainder - targetRemainder);
            if (remainderToCheck < 0) {
                remainderToCheck += p;
            }

            if (remainderToIndex.containsKey(remainderToCheck)) {
                int index = remainderToIndex.get(remainderToCheck);
                minLen = Math.min(minLen, i - index);
            }

            remainderToIndex.put(remainder, i);
        }

        return minLen >= n ? -1 : minLen;
    }
}

