var topKFrequent = function(nums, k) {
  let q = new MinPriorityQueue(v=>v[1]);
  let map = {};
  for(let i of nums) map[i] = (map[i] || 0) + 1;
  for(let key in map){
    q.enqueue([+key,map[key]]);
    if(q.size() > k) q.dequeue();
  }  
  let ans = [];
  while(q.size()){
    ans.push(q.dequeue()[0]);
  }
  return ans;
};
