    if(delta === 0) return 0;
    let ans = Infinity;
    let map = new Map();
    for(let i = 0;i <= n;i++){
        let b = sum[i],a = (b % p - delta % p + p) % p;
        map.set(b % p,i);
        if(map.has(a)) ans = Math.min(ans,i - map.get(a));
    }
    return ans === n ? -1 : ans;
};
