In JS, we need to build a double linked list data structure by our own. The rest of the logic is quite straight forward - which use hashmap to save key-node, and use linked list to store access frequency. 

```js
class DoubleLinkedListNode {
    constructor(key, value) {
        this.key = key;
        this.value = value;
        this.prev = null;
        this.next = null;
    }
}

class LRUCache {
    constructor(capacity) {
        this.capacity = capacity;
        this.usedSpace = 0;

        this.hashmap = {};
        this.dummyHead = new DoubleLinkedListNode(null, null);
        this.dummyTail = new DoubleLinkedListNode(null, null);
        this.dummyHead.next = this.dummyTail;
        this.dummyTail.prev = this.dummyHead;
    }

    _isFull() {
        return this.usedSpace === this.capacity;
    }
    _addToHead(node) {
        const currentHead = this.dummyHead.next;

        node.next = currentHead;
        node.prev = this.dummyHead;
        currentHead.prev = node;
        this.dummyHead.next = node;

        return node;
    }
    _removeNode(node) {
        node.prev.next = node.next;
        node.next.prev = node.prev;
        node.next = null
        node.prev = null
        return node
    }

    get(key) {
        if (this.hashmap[key] !== undefined) {
            const node = this.hashmap[key];
            this._addToHead(this._removeNode(node));
            return node.value
        } else {
            return -1
        }
    }
    put(key, value) {
        if (this.hashmap[key] !== undefined) {
            const node = this.hashmap[key];
            node.value = value;
            this._addToHead(this._removeNode(node))
        } else {
            if (this._isFull()) {
                const nodeNeedToEvict = this.dummyTail.prev;
                delete this.hashmap[nodeNeedToEvict.key];
                this._removeNode(nodeNeedToEvict);
                this.usedSpace --
            }
            const node = new DoubleLinkedListNode(key, value);
            this.hashmap[key] = node;
            this._addToHead(node);
            this.usedSpace ++
        }
    }
};
