var verticalTraversal = function(root) {
    const map = {}
    const queue = [{
        node: root,
        col: 0,
    }];
    let row = 0;;
    while(queue.length) {
        const size = queue.length;
        for(let i = 0; i < size; i++) {
            const cur = queue.shift();
            const node = cur.node;
            if (map[cur.col]?.[row] === undefined) {
                map[cur.col] = {
                    ...map[cur.col],
                    [row]: [node.val]
                }
            } else {
                map[cur.col][row].push(node.val);
            }
            if (node.left) queue.push({
                node: node.left, 
                col: cur.col - 1,
            })
            if (node.right) queue.push({
                node: node.right,
                col: cur.col + 1
            })
        }
        row ++
    }
    const orderByColumn = Object.entries(map).sort(([key1, _], [key2, __]) => Number(key1) - Number(key2));
    const flatternByColumn = orderByColumn.map(i => {
        const column = i[1];
        const arr = [];
        Object.entries(column).sort(([row1], [row2]) => row1 - row2).forEach(([_row, nodes]) => {
            const orderedNodes = nodes.sort((a, b) => a - b);
            arr.push(...orderedNodes)
        })
        return arr
    })
    return flatternByColumn
};
