/**
 * Encodes a tree to a single string.
 *
 * @param {TreeNode} root
 * @return {string}
 */
var serialize = function(root) {
    const result = [];

    function preorder(node) {
        if (node === null) {
            result.push('null');
            return;
        }

        result.push(node.val.toString());
        preorder(node.left);
        preorder(node.right);
    }

    preorder(root);
    return result.join(',');
};

/**
 * Decodes your encoded data to tree.
 *
 * @param {string} data
 * @return {TreeNode}
 */
var deserialize = function(data) {
    if (!data || data === 'null') {
        return null;
    }

    const values = data.split(',');
    let index = 0;

    function buildTree() {
        if (index >= values.length || values[index] === 'null') {
            index++;
            return null;
        }

        const node = new TreeNode(parseInt(values[index]));
        index++;

        node.left = buildTree();
        node.right = buildTree();

        return node;
    }

    return buildTree();
};

/**
