    const totalLen = wordLen * words.length;
    const result = [];

    // words
    const wordCount = new Map();
    for (const word of words) {
        wordCount.set(word, (wordCount.get(word) || 0) + 1);
    }

    // 0wordLen-1
    for (let i = 0; i < wordLen; i++) {
        let left = i;
        let right = i;
        let validWords = 0;
        const windowCount = new Map();

        while (right + wordLen <= s.length) {
            // 
            const rightWord = s.substring(right, right + wordLen);
            right += wordLen;

            if (wordCount.has(rightWord)) {
                windowCount.set(rightWord, (windowCount.get(rightWord) || 0) + 1);
                if (windowCount.get(rightWord) <= wordCount.get(rightWord)) {
                    validWords++;
                }

                // 
                while (right - left > totalLen) {
                    const leftWord = s.substring(left, left + wordLen);
                    left += wordLen;

                    if (wordCount.has(leftWord)) {
                        if (windowCount.get(leftWord) <= wordCount.get(leftWord)) {
                            validWords--;
                        }
                        windowCount.set(leftWord, windowCount.get(leftWord) - 1);
                    }
                }

                // 
                if (validWords === words.length && right - left === totalLen) {
                    result.push(left);
                }
            } else {
                // words
                windowCount.clear();
                validWords = 0;
                left = right;
            }
        }
    }

    return result;
};
