var minSubarray = function(nums, p) {
    // 
    const totalSum = nums.reduce((sum, num) => sum + num, 0);

    // p
    const remainder = totalSum % p;
    if (remainder === 0) {
        return 0;
    }

    // 
    const prefixMap = new Map();
    prefixMap.set(0, -1); // 0-1

    let prefixSum = 0;
    let minLength = nums.length; // 

    for (let i = 0; i < nums.length; i++) {
        prefixSum += nums[i];
        const currentRemainder = prefixSum % p;

        // remainder
        // currentRemainder - targetRemainder = remainder (mod p)
        // targetRemainder = (currentRemainder - remainder + p) % p
        const targetRemainder = (currentRemainder - remainder + p) % p;

        if (prefixMap.has(targetRemainder)) {
            const prevIndex = prefixMap.get(targetRemainder);
            const subarrayLength = i - prevIndex;
            minLength = Math.min(minLength, subarrayLength);
        }

        // 
        prefixMap.set(currentRemainder, i);
    }

    // 
    return minLength === nums.length ? -1 : minLength;
};
