class LRUCache {
public:
    struct Node {
        int key, val;
        Node *prev, *next;
        Node(int _key, int _val): key(_key), val(_val), prev(NULL), next(NULL){}
    }*L, *R; //L  R

    unordered_map<int, Node*> hash;
    int n;

    void delete_node(Node *p){
        p->next->prev = p->prev;
        p->prev->next = p->next;
    }

    void insert_node(Node *p){ //
        p->next = L->next;
        L->next->prev = p;
        p->prev = L;
        L->next = p;
    }

    LRUCache(int capacity) {
        n = capacity;
        L = new Node(-1, -1);
        R = new Node(-1, -1);
        L->next = R;
        R->prev = L;
    }

    int get(int key) {
        if(!hash.count(key)) return -1;
        else{
            auto p = hash[key];
            delete_node(p);
            insert_node(p);
            return p->val;
        }
    }

    void put(int key, int value) {
        if(!hash.count(key)){
            if(hash.size()==n){
                auto p = R->prev;
                delete_node(p);
                hash.erase(p->key);
            }
            auto p = new Node(key, value);
            hash[key] = p;
            insert_node(p);
        }else {
            auto p = hash[key];
            p->val = value;
            delete_node(p);
            insert_node(p);
        }
    }
};

