 * };
 */
class Solution {
public:
    //  map
    void dfs(TreeNode* node, int row, int col, map<int, vector<pair<int, int>>>& colNodes) {
        // 
        if (node == nullptr) {
            return;
        }

        // (, ) 
        colNodes[col].push_back({row, node->val});

        // +1-1
        dfs(node->left, row + 1, col - 1, colNodes);

        // +1+1
        dfs(node->right, row + 1, col + 1, colNodes);
    }

    // 
    static bool compareNodes(const pair<int, int>& a, const pair<int, int>& b) {
        // 
        if (a.first == b.first) {
            return a.second < b.second;
        }
        // 
        return a.first < b.first;
    }

    vector<vector<int>> verticalTraversal(TreeNode* root) {
        // key=value=(, )
        map<int, vector<pair<int, int>>> colNodes;

        // 
        dfs(root, 0, 0, colNodes);

        // 
        vector<vector<int>> result;

        // 
        for (auto& entry : colNodes) {
            // 
            sort(entry.second.begin(), entry.second.end(), compareNodes);

            // 
            vector<int> colValues;
            for (auto& node : entry.second) {
                colValues.push_back(node.second); // node.second
            }
            result.push_back(colValues);
        }

        return result;
    }
};

