class Solution {
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        unordered_map<string, int> hash;
        vector<int> res;
        int n = s.length(), m = words.size();
        if (n == 0 || m == 0)
            return res;
        int len = words[0].length(), end = n - m * len;
        if (n < m * len)
            return res;
        for (auto word : words)
            hash[word]++;
        int size = hash.size();
        for (int k = 0; k < len; k++) {
            unordered_map<string, int> cur_hash;
            int satisfy = 0;
            for (int i = k, j = k; j <= n - len;) {
                string cur = s.substr(j, len);
                if (hash.find(cur) == hash.end()) {
                    j = j + len;
                    i = j;
                    cur_hash.clear();
                    satisfy = 0;
                } else {
                    cur_hash[cur]++;
                    if (cur_hash[cur] == hash[cur])
                        satisfy++;
                    else if (cur_hash[cur] > hash[cur]) {
                        while (i < j && cur_hash[cur] > hash[cur]) {
                            string temp = s.substr(i, len);
                            i += len;
                            cur_hash[temp]--;
                            if (cur_hash[temp] == hash[temp] - 1)
                                satisfy--;
                        }
                    }
                    if (satisfy == size) {
                        string temp = s.substr(i, len);
                        cur_hash[temp]--;
                        satisfy--;
                        res.push_back(i);
                        i = i + len;
                    }
                    j = j + len;
                }
            }
        }
        return res;
    }
};
